import React from "react";
import { ThemeProvider, createTheme } from "@mui/material/styles";
import { Grid, CssBaseline, Box } from "@mui/material";
//import logo from "./logo.svg";
import "./App.css";
import Header from "./components/Header/Header";
//import List from "./components/List/List";
import Map from "./components/Map/Map";
import MyForm from "./components/test";

// Define your theme
const theme = createTheme({
  palette: {
    primary: {
      main: "#007bff", // Adjust color values as needed
    },
    secondary: {
      main: "#28a745", // Adjust color values as needed
    },
  },
  // Other theme options...
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Header />

      <Grid container spacing={6} style={{width:'100vw'}}>
        <Grid item >
          {/**<List />**/}
          <MyForm />
        </Grid>
        <Grid >
          <Map />
        </Grid>
      </Grid>

    </ThemeProvider>

  );
}

export default App;
